const Weather = () => {
    return (  
<div className="container">
    <div className="cards">
        <h1>Location</h1>
        <h2>25&deg;</h2>
        {minMaxTemp(19, 27)}
    </div>
</div>
    );
}

function minMaxTemp(min, max){
    return (
        <h3>
            <span>{min}&deg;</span>
            <span>{max}&deg;</span>
        </h3>
    )
}
export default Weather;
